import React from 'react';
import LogoTop from '../assets/components/LogoTop';
import Button from '../assets/components/Button';

export default function Final() {
    return (
        <>
            <LogoTop />
            <div className='pt-20 pb-10 text-center'>
                <button className="bg-white font-extrabold text-xl text-[#1B48E9] hover:opacity-90 rounded w-1/5 h-16 justify-self-center my-3 disabled:opacity-60">LEAVE</button>
            </div>
            <div class="flex justify-center items-end h-full gap-16">
                <div class="h-3/5 w-1/4 bg-gray-500"></div>
                <div class="h-4/5 w-1/4 bg-blue-500"></div>

                <div class="h-2/5 w-1/4 bg-yellow-500"></div>
            </div>



        </>
    )
}
